import { StyledContactSection } from "../styles/ContactSection.styled";
import { SectionHeading } from "../styles/SectionHeading.styled";

export const ContactSection = () => {
  return (
    <>
      <StyledContactSection>
        <SectionHeading>
          <h1>Contact</h1>
          <p>Get in touch</p>
        </SectionHeading>
      </StyledContactSection>
      <hr />
    </>
  );
};
